Nita is a {{Rarity|Rare}} [[Brawler]] who has moderately high health and attacks with shockwaves that have a moderate range and pierce through enemies, being able to hit multiple of them at the same time. She is most notable for her Super's ability to summon Bruce, a bear that has high health and quick melee attacks. Her first Gadget, Bear Paws, will briefly stun all enemies in an area around her Bear. Her second Gadget, Faux Fur, shields Bruce for a brief amount of time. Her first Star Power, Bear with Me, heals her Bear slightly but considerably whenever she herself hits an enemy with her attack, and heals her likewise whenever Bruce hits an enemy. Her second Star Power, Hyper Bear, increases the attack speed of Bruce. Her Hypercharge, Hyperbearing, increases her next Super's health and movement speed.

==Attack: Rupture==
{{Quote|Nita sends forth a shockwave, damaging enemies caught in the tremor.}}Nita releases a shockwave that deals moderate damage and reloads very fast. It has moderate range, and the shockwave is fairly wide. The attack pierces through enemies and is able to hit multiple at the same time.

==Super: Overbearing==
{{Quote|Nita summons the spirit of Big Baby Bear to hunt down her enemies.}}Nita summons a bear (Bruce) that chases down and attacks enemies. The Bear walks towards the nearest enemy even if they are in a bush and attempts to hit them with quick melee attacks that deal low damage. Bruce has slightly more health than Nita.

==Gadgets==
===Bear Paws===
{{Quote|Nita commands her bear to slam the ground, stunning all enemies within its reach.}}
{{Gadget|1}}
After a 1-second delay, Nita's Bear will stun enemies for 0.5 seconds within a 3.33 tile radius around it, allowing it to catch up to and attack them when this Gadget is used. The Gadget can only be used while Nita has a bear from her Super within 12 tiles of her current location on the map. 

===Faux Fur===
{{Quote|For the next 3 seconds, Nita's bear gets a 35% shield against damage.}}
{{Gadget|2}}
Nita's Bear will be shielded from attacks by 35% for 3 seconds. This is slightly more protective than most other shielding abilities; however, it is applied onto a mobile spawnable and not the Brawler itself. The Gadget can only be used while Nita has a bear from her Super within 12 tiles of her current location on the map.

==Star Powers==
===Bear with Me===
{{Quote|Nita recovers 1040 health whenever her bear hits an enemy brawler. When Nita deals damage to an enemy brawler, her bear regains 1040 health.}}
{{StarPower|1}}
This Star Power allows Nita to heal her Bear and her Bear to heal her when they attack enemy Brawlers respectively. After Nita or Bruce attack an enemy Brawler, small green effects fly out from them to her Bear or Nita to heal them, and they can be seen even when Nita and Bruce are inside a bush or Nita is invisible. Neither Nita nor Bruce can heal from attacking spawnables.  

===Hyper Bear===
{{Quote|Nita's bear attacks faster. Time between swipes is reduced by 60%.}}
{{StarPower|2}}
This allows Nita's bear to deal damage 2.5 times as fast as it usually would, and decreases Bruce's attack delay from 0.6 seconds to 0.24 seconds.

==Hypercharge: Hyperbearing==
{{Quote|Nita hypercharges Bruce, making him increase in size, giving him 15% increased movement speed and 20% increased health.}}{{Hypercharge}}
When activated, Nita's next bear will appear large. The enlarged bear will walk 15% faster and have 20% more health. She also gains a 26% speed boost, a 25% damage boost, and a 5% shield boost.

==Mutation==
{{RemovedContent|section}}
{{Quote|Nita summons another Bruce.}}<div style="float: right;">[[File:Mutation.png|64px|link=]]</div>With this mutation, Nita could summon an additional Bear with her Super. Her Bear Paws and Faux Fur Gadget only affected one of the Bears, although her Hypercharge affected both. 

==Tips==
=== Game Modes and Maps ===
*Bruce is particularly effective in [[Heist]], as you can launch the bear over enemies and obstacles to target the safe. Additionally, Nita's Hyper Bear Star Power greatly enhances her effectiveness in this game mode.
*Utilize Nita's Super to strengthen an aggressive push in [[Gem Grab]], helping your team seize control of the gem mine. The bear can absorb damage for your team, depleting the enemy's ammo, or it can be used to weaken opponents, making it an invaluable asset in battle.

=== Recommended Build ===
*Faux Fur's shield greatly increases Bear with Me's effectiveness. In Heist, using it with her Hyper Bear Star Power may be more favorable. In general, only use Hyper Bear in non-Heist modes when she is using Bear Paws. Bear with Me provides more consistent value in these cases.
*Nita’s Bear Paws Gadget can come into great effect if you have her Hyper Bear Star Power. Nita will be able to stun enemies and charge her Super again extremely fast, which can be useful against high-health Brawlers. However, it also works with her Bear with Me Star Power, allowing the bear to catch up to enemies and heal Nita more.

=== Strategies ===
*Nita's bear can effectively prevent the enemy he is chasing from healing up. The enemy will either have to attack, stopping or preventing natural healing, or get damaged, out of which the enemy will most likely choose the former. This can be used to pressure a weakened Gem carrier or other crucial opponent into getting easily defeated by Nita and her team.
*Bruce can also detect Brawlers hidden in bushes and pursue them. This can help Nita and her teammates locate hiding enemy Brawlers, effectively making it a scouting tool.
*Nita's Super can be thrown over walls, so it can come in handy for dealing with enemies that are hiding behind one. You can use the Bear Paws Gadget in these situations too to get more value off of Bruce and potentially defeat the enemies hiding behind a wall.

=== Other ===
*Nita's attack can hit multiple enemies from a fair distance away. Take advantage of this when enemies gather close together.
*Bruce has moderately high health, allowing Nita to create her own tank. The bear distracts enemies and absorbs fire, protecting Nita and giving her a chance to deal damage.
*Since Nita's Super is a thrown projectile, it will summon Bruce quicker if thrown toward an area closer to Nita. This is convenient when you are being attacked by a shotgun-wielding Brawler such as [[Shelly]] or [[Bull]] since the bear can tank the projectiles, allowing Nita to escape and counterattack.
*Nita's bear has a very short attack range, so it is best if supported or used in an enclosed area where the enemy will be unable to get past the bear.
*Nita can use her Super to spawn the bear on a launch pad to ambush unsuspecting enemy Brawlers. 
*Avoid hiding behind her bear when facing a [[Penny]] or [[Jessie]] since the splash attack will have a devastating effect on Nita.
*When facing a Brawler with non-piercing attacks, place Bruce a few tiles in front of you to make them waste their ammo on Bruce, during which you and Bruce can effectively finish them off.
*When facing an enemy Frank, always have the Bear Paws Gadget ready to cancel Frank’s Super when he’s about to stun you, Bruce, and your teammates. This will not only cancel Frank’s Super in the process, therefore defusing it, but also give ample time for teammates to defeat Frank.

